import {Table, Modal} from "../component/Component";
import { useState } from "react";

function Siswa() {
  const [modal, setModal] = useState(false);
  const funcModal = () => {
    setModal(!modal);
  };
  return (
    <div className="w-full h-screen flex">
        <Table />
        <Modal set={funcModal} stat={modal}/>
    </div>
  );
}
export default Siswa;
